export function getFontOptionsFromFontPaths() {
  return [
    {
      name: 'Alumni Sans',
      data: ``,
      weight: 400,
      style: 'normal',
    },
    {
      name: 'Alumni Sans',
      data: ``,
      weight: 400,
      style: 'italic',
    },
  ].map((v) => ({
    ...v,
    data: base64StringToArrayBuffer(v.data),
  })) as any;
}

function base64StringToArrayBuffer(data: string): ArrayBuffer {
  const buff = Buffer.from(data, 'base64');

  const arrayBuff = buff.buffer.slice(buff.byteOffset, buff.byteOffset + buff.byteLength);

  return arrayBuff as ArrayBuffer;
}
